script: |
  super -f text -I q7259.spq | sort > q7259.out

inputs:
  - name: q7259.spq
    data: |
      SELECT ALL col1 - + - col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - col2 * 10 + + + col2 - - 23 + col1 / + - col1 * - col0 NOT IN ( ( + col0 ) * - col1 + col2 + 8 - + ( col0 ) + + ( - + col2 ) * - col2, + col1 );
  - name: tab2

outputs:
  - name: q7259.out
    data: |
